import { withRouter } from 'react-router-dom';

import React, { Component }  from 'react';
import Carousel from "react-bootstrap/Carousel";

function Home(props)
{
    const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex, e) => {
    setIndex(selectedIndex);
  };

    // const images = [
    //     'https://storage.googleapis.com/production-websitebuilder-v1-0-3/823/214823/XIuoGeyR/97dd5fc32e324b94ae982e5163d02407',
    //     'https://www.atlanticcouncil.org/wp-content/uploads/2019/07/201907390_IsraelBeachPollution_Full.jpg',
    //     'https://www.bayerjovens.com.br/html/images/fique-ligado/reciclar-ou-reutilizar-1.png',
    //     'https://previews.123rf.com/images/imagesourceprem/imagesourceprem1706/imagesourceprem170689093/82296042-group-of-people-with-recycling-in-bins.jpg'
    //   ]

      return (
        <Carousel activeIndex={index} onSelect={handleSelect}>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src='https://storage.googleapis.com/production-websitebuilder-v1-0-3/823/214823/XIuoGeyR/97dd5fc32e324b94ae982e5163d02407'
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src='https://www.atlanticcouncil.org/wp-content/uploads/2019/07/201907390_IsraelBeachPollution_Full.jpg'
            alt="Second slide"
          />
  
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src='https://www.bayerjovens.com.br/html/images/fique-ligado/reciclar-ou-reutilizar-1.png'
            alt="Third slide"
          />
  
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
      )

}

export default withRouter(Home);
